    "2015-07-08T19:05:37.685924",nt"name": "aces-log-data-v1",nt"isopen":
    true,nt"url": null,nt"notes": "The ALTUS Cloud Electrification Study (ACES)
    was Based at the Naval Air Facility Key West in Florida. ACES researchers in August
    2002 conducted overflights of thunderstorms over the southwestern corner of Florida.
    For the first time in NASA research an uninhabited aerial vehicle (UAV) named ALTUS
    was used to collect cloud electrification data. Carrying field mills, optical sensors,
    electric field sensors and other instruments, it allowed scientists to collect cloud
    electrification data for the first time from above the storm from it's birth through
    dissipation. This experiment allowed scientists to achieve the dual goals of gathering
    weather data safely, and testing new aircraft technology.  This dataset consists
    of log data from each flight. It yields instrument and aircraft status throughout
    the flight.",nt"license_title": "U.S. Government Work",nt"extras": [{ntt"key":
